    "a99add10-9bf2-4cae-a6f7-ed0cb69c811f": {"id":"a99add10-9bf2-4cae-a6f7-ed0cb69c811f","project_id":14265,"key":36581414,"version":null,"meta":null,"children":[],"deleted_at":null,"created_at":"2022-09-26T00:26:29.235Z","updated_at":"2022-09-26T00:26:29.235Z","props":{"content":"\u003ch2 data-type=\"heading-two\"\u003e\u003cp data-type=\"paragraph\"\u003e\u003cspan class=\"css-18l6ruy-rules\" style=\"color:#004c97\" data-type=\"color\"\u003e\u003cstrong data-type=\"bold\"\u003eTips for password protection\u003c/strong\u003e\u003c/span\u003e\u003c/p\u003e\u003c/h2\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003eWe saw some of the mistakes Jenny made and the impact this had on the security of her passwords. But what other things should we think about to keep our passwords at home and work safe?\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003eRight now, you might take the same approach to password protection as Jenny. Is there a safer way?\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003cstrong data-type=\"bold\"\u003eClick the two headings on the right\u003c/strong\u003e to find out more about password protection dos and don’ts.\u003c/p\u003e"},"type":"Text"}, 
