    "78e3d2a2-26b2-4206-a47c-6c409cb18e93": {"id":"78e3d2a2-26b2-4206-a47c-6c409cb18e93","project_id":14265,"key":36580099,"version":null,"meta":null,"children":[],"deleted_at":null,"created_at":"2022-09-26T00:26:17.404Z","updated_at":"2022-09-26T00:26:17.404Z","props":{"useBackgroundControls":false,"content":"\u003cdiv class=\"chameleon-text-align-left\" data-type=\"textAlignLeft\"\u003e\u003cp data-type=\"paragraph\"\u003eUnlike passwords they tend to be longer and easier to remember. For example, P%69y_#krPQ? and 4_Happy Cats Wear Hats are equally secure.\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003eBut without writing it down remembering the first password is tough!\u003c/p\u003e\u003c/div\u003e"},"type":"Text"}, 
    "dd64f73c-7c24-4ea5-b73b-1ba8aca4a240": {"id":"dd64f73c-7c24-4ea5-b73b-1ba8aca4a240","project_id":14265,"key":36580098,"version":null,"meta":null,"children":[],"deleted_at":null,"created_at":"2022-09-26T00:26:17.396Z","updated_at":"2022-09-26T00:26:17.396Z","props":{"content":"\u003cp data-type=\"paragraph\"\u003eMFA is technology designed to verify our identity. It creates a layered defense making it more difficult for unauthorised users to access our information if our passwords have been compromised.\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003eTo pass MFA a user needs to have two or more pieces of information verified before they will be granted access.\u003c/p\u003e"},"type":"Text"}, 
    "aaf590aa-89c6-4fbb-a743-7887bdbdde55": {"id":"aaf590aa-89c6-4fbb-a743-7887bdbdde55","project_id":14265,"key":36580097,"version":null,"meta":null,"children":[],"deleted_at":null,"created_at":"2022-09-26T00:26:17.390Z","updated_at":"2022-09-26T00:26:17.390Z","props":{"content":"\u003ch2 data-type=\"heading-two\"\u003e\u003cp data-type=\"paragraph\"\u003e\u003cspan class=\"css-18l6ruy-rules\" style=\"color:#004c97\" data-type=\"color\"\u003e\u003cstrong data-type=\"bold\"\u003ePassword hygiene\u003c/strong\u003e\u003c/span\u003e\u003c/p\u003e\u003c/h2\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003eOur passwords are one of our best defences against cyberthreats. But how easy is it to hack into them?\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003eLet’s put our hacker skills to the test as we look at Jenny\u0026#x27;s passwords. \u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003cstrong data-type=\"bold\"\u003eCan you crack Jenny’s password to break into your module?\u003c/strong\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003cstrong data-type=\"bold\"\u003eClick the arrows to see both carousel slides.  \u003c/strong\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003cstrong data-type=\"bold\"\u003eNote for keyboard users:\u003c/strong\u003e when you\u0026#x27;re ready to move on to the next slide within the carousel, ensure the \u0026#x27;next slide\u0026#x27; button is selected, then press enter.\u003c/p\u003e"},"type":"Text"}, 
    "540ff0ef-2c16-4e48-93f7-4f49256d9685": {"id":"540ff0ef-2c16-4e48-93f7-4f49256d9685","project_id":14265,"key":36580096,"version":null,"meta":null,"children":[],"deleted_at":null,"created_at":"2022-09-26T00:26:17.384Z","updated_at":"2022-09-26T00:26:17.384Z","props":{"content":"\u003ch2 data-type=\"heading-two\"\u003e\u003cp data-type=\"paragraph\"\u003e\u003cspan class=\"css-18l6ruy-rules\" style=\"color:#004c97\" data-type=\"color\"\u003e\u003cstrong data-type=\"bold\"\u003eMulti-factor authentication\u003c/strong\u003e\u003c/span\u003e\u003c/p\u003e\u003c/h2\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003eOn top of choosing strong, unique passwords or phrases across different sites and accounts, Multi-factor authentication (MFA) is another layer of protection we can add to boost our password security.\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003eMFA is a secure way to check we are who we say we are. It’s similar to two-factor authentication (2FA) where you will be asked to provide two pieces of information to confirm your identity based on what you know or what you have.\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003eFor example, when you go to the ATM you are asked to insert your card (what you have) and enter your PIN (what you know). This is 2FA in action.\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003eMFA will take this a step further and ask for up to three pieces of information, including your unique biometric data.\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003cstrong data-type=\"bold\"\u003eClick the three headings on the right to find out more.\u003c/strong\u003e\u003c/p\u003e"},"type":"Text"}, 
