    "72a4cc18-1092-4bcd-89c4-355ce35dfa81": {"id":"72a4cc18-1092-4bcd-89c4-355ce35dfa81","project_id":14265,"key":36580597,"version":null,"meta":null,"children":[{"id":"9e4db61a-d848-4cbe-acc9-c2c081b728e0","type":"Ref"},{"id":"ae6ccd75-427b-4aa0-8f62-25d15f3f35e7","type":"Ref"},{"id":"40a9085b-bb31-41a1-8568-73f671d06dbe","type":"Ref"},{"id":"13227144-fdfb-4f0a-a268-23a50e8760af","type":"Ref"},{"id":"df943260-0223-4777-b9a3-7203423dce72","type":"Ref"},{"id":"87ccbcbb-bab7-4e88-80ef-3e86d5c1ec5d","type":"Ref"}],"deleted_at":null,"created_at":"2022-09-26T00:26:21.715Z","updated_at":"2022-09-26T00:26:34.437Z","props":{},"type":"Carousel"}, 
    "32f6bd24-9da5-4364-8360-a56e724e29bd": {"id":"32f6bd24-9da5-4364-8360-a56e724e29bd","project_id":14265,"key":36580596,"version":null,"meta":null,"children":[],"deleted_at":null,"created_at":"2022-09-26T00:26:21.709Z","updated_at":"2022-09-26T00:26:21.709Z","props":{"content":"\u003cdiv class=\"chameleon-text-align-left\" data-type=\"textAlignLeft\"\u003e\u003cp data-type=\"paragraph\"\u003eIt’s the fear of not remembering our passwords that can lead to bad habits like reusing the same, or a variation of the same, password over and over again or writing down reminders or even the password itself.\u003c/p\u003e\u003c/div\u003e"},"type":"Text"}, 
    "02d18699-7039-4460-b077-3f1851e63fc6": {"id":"02d18699-7039-4460-b077-3f1851e63fc6","project_id":14265,"key":36580595,"version":null,"meta":null,"children":[],"deleted_at":null,"created_at":"2022-09-26T00:26:21.703Z","updated_at":"2022-09-26T00:26:21.703Z","props":{"content":"\u003cdiv class=\"chameleon-text-align-left\" data-type=\"textAlignLeft\"\u003e\u003cp data-type=\"paragraph\"\u003ePassword vaults or password managers are a secure way to store your passwords. You will be asked to choose a master password, and this is all you need to remember. Once you enter your master password the vault will open revealing all your stored passwords for different sites or systems.\u003c/p\u003e\u003c/div\u003e"},"type":"Text"}, 
    "73b96a24-3a50-473f-8a52-514890db3809": {"id":"73b96a24-3a50-473f-8a52-514890db3809","project_id":14265,"key":36580594,"version":null,"meta":null,"children":[],"deleted_at":null,"created_at":"2022-09-26T00:26:21.698Z","updated_at":"2022-09-26T00:26:21.698Z","props":{"content":"\u003cdiv class=\"chameleon-text-align-left\" data-type=\"textAlignLeft\"\u003e\u003cp data-type=\"paragraph\"\u003ePassword vaults don’t only store passwords, they help you generate and save strong, unique passwords when you sign up to new websites. Most password vaults allow you to copy and paste passwords when you need them, making life easier and safer for us all, especially in public places where we run the risk of someone watching us enter our passwords.\u003c/p\u003e\u003c/div\u003e"},"type":"Text"}, 
    "38a79f4c-c38a-4e86-bdab-169755c6e0b7": {"id":"38a79f4c-c38a-4e86-bdab-169755c6e0b7","project_id":14265,"key":36580593,"version":null,"meta":null,"children":[],"deleted_at":null,"created_at":"2022-09-26T00:26:21.691Z","updated_at":"2022-09-26T00:26:21.691Z","props":{"content":"\u003cdiv class=\"chameleon-text-align-left\" data-type=\"textAlignLeft\"\u003e\u003cp data-type=\"paragraph\"\u003eBut why should we use a password vault? Imagine you’ve just had your password compromised at work. You need to change passwords, report the risk and try to find out how much information the hacker has access to. If you use the same password repeatedly this could be everything you do!\u003c/p\u003e\u003c/div\u003e"},"type":"Text"}, 
    "3608301a-3ce4-433e-a4f2-ccbd753af3e5": {"id":"3608301a-3ce4-433e-a4f2-ccbd753af3e5","project_id":14265,"key":36580592,"version":null,"meta":null,"children":[],"deleted_at":null,"created_at":"2022-09-26T00:26:21.685Z","updated_at":"2022-09-26T00:26:21.685Z","props":{"content":"\u003cdiv class=\"chameleon-text-align-left\" data-type=\"textAlignLeft\"\u003e\u003cp data-type=\"paragraph\"\u003eNow imagine you use the same password for everything at home and at work… looks like your day just got worse. Now you’ll need to contact the bank, cancel cards, change passwords, reset email accounts and hope that your hard-earned savings are still where you stashed them! Don’t use the same or a variation of the same password especially across work and personal accounts. Instead use a password vault.\u003c/p\u003e\u003c/div\u003e"},"type":"Text"}, 
    "66b7399b-1bf0-4124-8685-0b7d3315adc0": {"id":"66b7399b-1bf0-4124-8685-0b7d3315adc0","project_id":14265,"key":36580591,"version":null,"meta":null,"children":[],"deleted_at":null,"created_at":"2022-09-26T00:26:21.680Z","updated_at":"2022-09-26T00:26:21.680Z","props":{"content":"\u003cdiv class=\"chameleon-text-align-left\" data-type=\"textAlignLeft\"\u003e\u003cp data-type=\"paragraph\"\u003eYour organisation may have a preferred password vault you can use. If not, research a reputable one to use. If you find remembering lots of different passwords hard, check them out or speak to your manager about password hygiene in your organisation.\u003c/p\u003e\u003c/div\u003e"},"type":"Text"}, 
    "acb7fe07-22bc-4c54-9f05-ddb4b812fcc3": {"id":"acb7fe07-22bc-4c54-9f05-ddb4b812fcc3","project_id":14265,"key":36580589,"version":null,"meta":null,"children":[],"deleted_at":null,"created_at":"2022-09-26T00:26:21.668Z","updated_at":"2022-09-26T00:26:21.668Z","props":{"useBackgroundControls":false,"bulletColor":"#fff","content":"\u003cdiv class=\"chameleon-text-align-left\" data-type=\"textAlignLeft\"\u003e\u003cp data-type=\"paragraph\"\u003eA good passphrase should be something memorable to you, that makes little sense to someone else and does not include references to personal details, like Horsestaplebattery.\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003eWhile passphrases are not ‘uncrackable’ they take far longer to crack than most passwords.\u003c/p\u003e\u003c/div\u003e"},"type":"Text"}, 
    "4941384a-d615-4b74-a227-4f0837508e3d": {"id":"4941384a-d615-4b74-a227-4f0837508e3d","project_id":14265,"key":36580588,"version":null,"meta":null,"children":[],"deleted_at":null,"created_at":"2022-09-26T00:26:21.660Z","updated_at":"2022-09-26T00:26:21.660Z","props":{"useBackgroundControls":false,"content":"\u003cp data-type=\"paragraph\"\u003eEmail phishing\u003c/p\u003e"},"type":"Text"}, 
