    "977c4f15-fb32-46d7-bfe9-afe421bb7c74": {"id":"977c4f15-fb32-46d7-bfe9-afe421bb7c74","project_id":14265,"key":36580542,"version":null,"meta":null,"children":[],"deleted_at":null,"created_at":"2022-09-26T00:26:21.367Z","updated_at":"2022-09-26T00:26:21.367Z","props":{"src":"/@editor/1.2.17/images/Carousel_Placeholder.png","fit":"cover"},"type":"Image"}, 
    "f40a30d8-968e-4b7f-950c-d36316361a94": {"id":"f40a30d8-968e-4b7f-950c-d36316361a94","project_id":14265,"key":36580541,"version":null,"meta":null,"children":[],"deleted_at":null,"created_at":"2022-09-26T00:26:21.354Z","updated_at":"2022-09-26T00:26:21.354Z","props":{"content":"\u003cdiv class=\"chameleon-text-align-left\" data-type=\"textAlignLeft\"\u003e\u003cp data-type=\"paragraph\"\u003ePassword vaults don’t only store passwords, they help you generate and save strong, unique passwords when you sign up to new websites. Most password vaults allow you to copy and paste passwords when you need them, making life easier and safer for us all, especially in public places where we run the risk of someone watching us enter our passwords.\u003c/p\u003e\u003c/div\u003e"},"type":"Text"}, 
    "05ae364c-e9e8-4a0b-81fd-576f3e63bab3": {"id":"05ae364c-e9e8-4a0b-81fd-576f3e63bab3","project_id":14265,"key":36580540,"version":null,"meta":null,"children":[],"deleted_at":null,"created_at":"2022-09-26T00:26:21.332Z","updated_at":"2022-09-26T00:26:21.332Z","props":{"src":"/@editor/1.2.17/images/Carousel_Placeholder.png","fit":"cover"},"type":"Image"}, 
    "3869f0f8-6c89-43a0-9ef3-b15b06200cc0": {"id":"3869f0f8-6c89-43a0-9ef3-b15b06200cc0","project_id":14265,"key":36580539,"version":null,"meta":null,"children":[],"deleted_at":null,"created_at":"2022-09-26T00:26:21.322Z","updated_at":"2022-09-26T00:26:21.322Z","props":{"content":"\u003cdiv class=\"chameleon-text-align-left\" data-type=\"textAlignLeft\"\u003e\u003cp data-type=\"paragraph\"\u003eBut why should we use a password vault? Imagine you’ve just had your password compromised at work. You need to change passwords, report the risk and try to find out how much information the hacker has access to. If you use the same password repeatedly this could be everything you do!\u003c/p\u003e\u003c/div\u003e"},"type":"Text"}, 
    "c43b6a97-5cff-44fd-877f-bd4fbee28a59": {"id":"c43b6a97-5cff-44fd-877f-bd4fbee28a59","project_id":14265,"key":36580538,"version":null,"meta":null,"children":[],"deleted_at":null,"created_at":"2022-09-26T00:26:21.312Z","updated_at":"2022-09-26T00:26:21.312Z","props":{"src":"/@editor/1.2.17/images/Carousel_Placeholder.png","fit":"cover"},"type":"Image"}, 
    "6664bcfa-9474-400b-8b60-6e7c1be7071e": {"id":"6664bcfa-9474-400b-8b60-6e7c1be7071e","project_id":14265,"key":36580537,"version":null,"meta":null,"children":[],"deleted_at":null,"created_at":"2022-09-26T00:26:21.298Z","updated_at":"2022-09-26T00:26:21.298Z","props":{"content":"\u003cdiv class=\"chameleon-text-align-left\" data-type=\"textAlignLeft\"\u003e\u003cp data-type=\"paragraph\"\u003eNow imagine you use the same password for everything at home and at work… looks like your day just got worse. Now you’ll need to contact the bank, cancel cards, change passwords, reset email accounts and hope that your hard-earned savings are still where you stashed them! Don’t use the same or a variation of the same password especially across work and personal accounts. Instead use a password vault.\u003c/p\u003e\u003c/div\u003e"},"type":"Text"}, 
    "6c4f3d16-6a94-4d68-b18a-f5cb24d3eee6": {"id":"6c4f3d16-6a94-4d68-b18a-f5cb24d3eee6","project_id":14265,"key":36580536,"version":null,"meta":null,"children":[],"deleted_at":null,"created_at":"2022-09-26T00:26:21.290Z","updated_at":"2022-09-26T00:26:21.290Z","props":{"src":"/@editor/1.2.17/images/Carousel_Placeholder.png","fit":"cover"},"type":"Image"}, 
    "ae70927a-9ecd-45cb-997d-dbfd0fbbd7f8": {"id":"ae70927a-9ecd-45cb-997d-dbfd0fbbd7f8","project_id":14265,"key":36580535,"version":null,"meta":null,"children":[],"deleted_at":null,"created_at":"2022-09-26T00:26:21.279Z","updated_at":"2022-09-26T00:26:21.279Z","props":{"content":"\u003cdiv class=\"chameleon-text-align-left\" data-type=\"textAlignLeft\"\u003e\u003cp data-type=\"paragraph\"\u003eYour organisation may have a preferred password vault you can use. If not, research a reputable one to use. If you find remembering lots of different passwords hard, check them out or speak to your manager about password hygiene in your organisation.\u003c/p\u003e\u003c/div\u003e"},"type":"Text"}, 
