    "fc84f6a5-7e16-4866-9b09-6db832ce0791": {"id":"fc84f6a5-7e16-4866-9b09-6db832ce0791","project_id":14265,"key":36580029,"version":null,"meta":null,"children":[],"deleted_at":null,"created_at":"2022-09-26T00:26:16.775Z","updated_at":"2022-09-26T00:26:16.775Z","props":{"src":"images/image_871198.gif","imageId":871198,"width":720,"height":720},"type":"Image"}, 
    "e7c374e3-41e7-4c6a-b198-8ccc1f66e1b9": {"id":"e7c374e3-41e7-4c6a-b198-8ccc1f66e1b9","project_id":14265,"key":36580028,"version":null,"meta":null,"children":[],"deleted_at":null,"created_at":"2022-09-26T00:26:16.770Z","updated_at":"2022-09-26T00:26:16.770Z","props":{"content":"\u003ch2 data-type=\"heading-two\"\u003e\u003cp data-type=\"paragraph\"\u003e\u003cstrong data-type=\"bold\"\u003e\u003cspan class=\"css-wuezvu-rules\" style=\"color:#fff\" data-type=\"color\"\u003eWhat is a passphrase?\u003c/span\u003e\u003c/strong\u003e\u003c/p\u003e\u003c/h2\u003e\u003cdiv class=\"chameleon-text-align-left\" data-type=\"textAlignLeft\"\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003c/div\u003e\u003cdiv class=\"chameleon-text-align-center\" data-type=\"textAlignCenter\"\u003e\u003cp data-type=\"paragraph\"\u003e\u003cspan class=\"css-wuezvu-rules\" style=\"color:#fff\" data-type=\"color\"\u003eAs cyberthreats evolve we’ve trained ourselves to choose passwords that are hard to remember but easy for computers to guess.\u003c/span\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003cspan class=\"css-wuezvu-rules\" style=\"color:#fff\" data-type=\"color\"\u003eWe tend to use predictable patterns to create passwords based on what we’ll remember like names, dates, places and common words. When asked to make something memorable and secure we add in a few capital letters, some special characters and sleep soundly knowing we’ve done our part. But have we?\u003c/span\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003cspan class=\"css-wuezvu-rules\" style=\"color:#fff\" data-type=\"color\"\u003eA better option is to use a passphrase.\u003c/span\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003cstrong data-type=\"bold\"\u003e\u003cspan class=\"css-wuezvu-rules\" style=\"color:#fff\" data-type=\"color\"\u003eClick on the three cards below to learn more about them.\u003c/span\u003e\u003c/strong\u003e\u003c/p\u003e\u003c/div\u003e"},"type":"Text"}, 
    "ffa76877-2e36-4655-b76c-693090a2e7dc": {"id":"ffa76877-2e36-4655-b76c-693090a2e7dc","project_id":14265,"key":36580027,"version":null,"meta":null,"children":[],"deleted_at":null,"created_at":"2022-09-26T00:26:16.763Z","updated_at":"2022-09-26T00:26:16.763Z","props":{"src":"images/image_865515.svg","imageId":865515,"description":"Jenny's password post-its","width":150,"height":150},"type":"Image"}, 
