    "a5ff0f55-4f62-408e-b125-b34185c41842": {"id":"a5ff0f55-4f62-408e-b125-b34185c41842","project_id":14265,"key":36580001,"version":null,"meta":null,"children":[],"deleted_at":null,"created_at":"2022-09-26T00:26:16.553Z","updated_at":"2022-09-26T00:26:16.553Z","props":{"useBackgroundControls":false,"content":"\u003cdiv class=\"chameleon-text-align-left\" data-type=\"textAlignLeft\"\u003e\u003ch4 data-type=\"heading-four\"\u003e\u003cp data-type=\"paragraph\"\u003e\u003cspan class=\"css-wuezvu-rules\" style=\"color:#fff\" data-type=\"color\"\u003e\u003cstrong data-type=\"bold\"\u003eGoogle Compromise Tool\u003c/strong\u003e\u003c/span\u003e\u003c/p\u003e\u003c/h4\u003e\u003cp data-type=\"paragraph\"\u003e\u003cspan class=\"css-wuezvu-rules\" style=\"color:#fff\" data-type=\"color\"\u003e\u003c/span\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003cspan class=\"css-wuezvu-rules\" style=\"color:#fff\" data-type=\"color\"\u003eGoogle compromise is available across all Chrome and Android devices. It will tell you if your accounts and passwords have been compromised, if you’re using weak passwords, and alerts you if your passwords are being used across multiple accounts.\u003c/span\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003cspan class=\"css-wuezvu-rules\" style=\"color:#fff\" data-type=\"color\"\u003e\u003c/span\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003cspan class=\"css-wuezvu-rules\" style=\"color:#fff\" data-type=\"color\"\u003eTo use this tool simply login to \u003c/span\u003e\u003ca href=\"https://passwords.google.com/\" title=\"passwords.google.com\" target=\"_blank\" style=\"color:inherit;cursor:pointer\" data-type=\"link\"\u003e\u003cspan class=\"css-wuezvu-rules\" style=\"color:#fff\" data-type=\"color\"\u003epasswords.google.com\u003c/span\u003e\u003c/a\u003e\u003cspan class=\"css-wuezvu-rules\" style=\"color:#fff\" data-type=\"color\"\u003e, select check passwords and follow the next steps to activate this tool.\u003c/span\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003cspan class=\"css-wuezvu-rules\" style=\"color:#fff\" data-type=\"color\"\u003e\u003c/span\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003cspan class=\"css-wuezvu-rules\" style=\"color:#fff\" data-type=\"color\"\u003eYou can choose to receive notifications if any of your saved passwords appear online or have these alerts turned off.\u003c/span\u003e\u003c/p\u003e\u003c/div\u003e"},"type":"Text"}, 
    "48265d5d-1a04-4ef3-89e3-271efbaa70de": {"id":"48265d5d-1a04-4ef3-89e3-271efbaa70de","project_id":14265,"key":36579999,"version":null,"meta":null,"children":[],"deleted_at":null,"created_at":"2022-09-26T00:26:16.530Z","updated_at":"2022-09-26T00:26:16.530Z","props":{"content":"\u003ch2 data-type=\"heading-two\"\u003e\u003cp data-type=\"paragraph\"\u003e\u003cspan class=\"css-18l6ruy-rules\" style=\"color:#004c97\" data-type=\"color\"\u003e\u003cstrong data-type=\"bold\"\u003eJenny\u0026#x27;s password has been compromised\u003c/strong\u003e\u003c/span\u003e\u003c/p\u003e\u003c/h2\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003eJenny’s learning new ways to manage her passwords that protect her organisation, information and personal details.\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003eShe’s changed her old password to unique, secure passphrases across each account she accesses, regularly uses and updates her password vault, has activated MFA on her accounts and is more aware of the information that can easily be found on social media.\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003eHowever, this morning she found out one of her passwords has been compromised.\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003cstrong data-type=\"bold\"\u003eSelect the two actions, from the four options available, Jenny should take to resolve this and restore her password protection.\u003c/strong\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e"},"type":"Text"}, 
