    "80eaaf9d-2908-46df-8257-a5b0824d48c1": {"id":"80eaaf9d-2908-46df-8257-a5b0824d48c1","project_id":14265,"key":36579510,"version":null,"meta":null,"children":[],"deleted_at":null,"created_at":"2022-09-26T00:26:12.106Z","updated_at":"2022-09-26T00:26:12.106Z","props":{"content":"\u003ch2 data-type=\"heading-two\"\u003e\u003cp data-type=\"paragraph\"\u003e\u003cspan class=\"css-18l6ruy-rules\" style=\"color:#004c97\" data-type=\"color\"\u003e\u003cstrong data-type=\"bold\"\u003eChoose a secure passphrase\u003c/strong\u003e\u003c/span\u003e\u003c/p\u003e\u003c/h2\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003eJenny took our advice and replaced her password with a secure passphrase.\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003eNow it’s your turn.\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003eThink about the passwords or phrases you use today. How secure are these?\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003cstrong data-type=\"bold\"\u003eSelect two things, from the four options below, you will keep in mind as you choose a secure passphrase in the future.\u003c/strong\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e"},"type":"Text"}, 
    "bdcb61a2-883d-40a8-9e44-59e0e3792033": {"id":"bdcb61a2-883d-40a8-9e44-59e0e3792033","project_id":14265,"key":36579509,"version":null,"meta":null,"children":[],"deleted_at":null,"created_at":"2022-09-26T00:26:12.096Z","updated_at":"2022-09-26T00:26:12.096Z","props":{"content":"\u003ch2 data-type=\"heading-two\"\u003e\u003cp data-type=\"paragraph\"\u003e\u003cspan class=\"css-18l6ruy-rules\" style=\"color:#004c97\" data-type=\"color\"\u003e\u003cstrong data-type=\"bold\"\u003eYes, we know, remembering passwords is hard\u003c/strong\u003e\u003c/span\u003e\u003c/p\u003e\u003c/h2\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003eRemembering lots of different passwords can be hard. Especially when you aren’t supposed to use a single password for everything!\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003eMost of us take our physical security seriously; we’ve got a separate key for our car, office, house and even the shed – so, why use the same password for everything else that matters to you? Our digital security is just as important.\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003ePassword vaults are a tool to help you adopt a better approach to password hygiene. Let’s find out more about them.\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003cstrong data-type=\"bold\"\u003eClick the arrows to move through the six carousel slides and find out more about them.  \u003c/strong\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003cstrong data-type=\"bold\"\u003eNote for keyboard users:\u003c/strong\u003e when you\u0026#x27;re ready to move on to the next slide within the carousel, ensure the \u0026#x27;next slide\u0026#x27; button is selected, then press enter.\u003c/p\u003e"},"type":"Text"}, 
